import './App.css';
import { Navbar } from './Components/TopNavbar/Navbar';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
import { Marketplace } from './Pages/Marketplace';



function App() {
  return (
    <div>
      <BrowserRouter>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Marketplace/>}/>


      </Routes>


      </BrowserRouter>
    </div>
  );
}

export default App;
